 const ItemInfo=({info})=> {
    const renderInfo=()=>{
        return(
            <div>
                <h1>{info.name}</h1>
                <p>Price: {info.price}</p>
            </div>
        )
    }

        return(
            <div className="col-md-4">{renderInfo()}</div>
        )
    
 }

 export default ItemInfo;
